import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Links = () => {
  return (
    <LinkBox>
      <Link to="/">Home</Link>
      <Link to="/upload">게시글 등록</Link>
    </LinkBox>
  );
};

export default Links;

const LinkBox = styled.div`
  display: flex;
  width: 100%;
  justify-content: center;
`;
